import axios from 'axios';
import React, { useEffect, useState } from 'react';
import Button from "react-bootstrap/Button";
import "./CreatePlanta.css";
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import Image from "react-bootstrap/Image";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink,
  Link
} from "react-router-dom";

function CrearP() {

  const [nombre, setNombre] = useState([]);
  const [provincia, setProvincia] = useState([]);
  const [canton, setCanton] = useState([]);
  const [distrito, setDistrito] = useState([]);
  const [direccionExacta, setDireccionExacta] = useState([]);
  const [telefono, setTelefono] = useState([]);
  const [idTipoVehiculo, setIdTipoVehiculo] = useState([]);
  const [idPlanta, setIdPlanta] = useState([]);
  const [espacioDisponible, setEspacioDisponible] = useState([]);
 
  const a =""
  const b =""
  const c =""
  const d =""
  const e =""
  const f =""

  const setDatos = (a,b,c,d,e,f,) => {
    setNombre(a);
    setProvincia(b);
    setCanton(c);
    setDistrito(d);
    setDireccionExacta(e);
    setTelefono(f);
  }

  useEffect(() => {
    (async () => {
        const res = await axios.post(`http://localhost:8090/api/CrearPlanta`, { 
            nombre: nombre,
            provincia: provincia,
            canton: canton,
            distrito: distrito,
            direccion_exacta: direccionExacta,
            telefono: telefono
        });

        const res2 = await axios.post(`http://localhost:8090/api/CrearBloque`, { 
            idTipoVehiculo: idTipoVehiculo,
            idPlanta: idPlanta,
            espacioDisponible: espacioDisponible
        });

        const res3 = await axios.get(`http://localhost:8090/api/GetIDPlanta`, { 
            nombre: nombre
        });

