            if(res.data[0][0]!==undefined){
                setOrderID(res.data[0][0].Num_Factura);
                setSalesBody(res2.data);
                setSales(res.data[0]);
            }else{
                setSales([]);
                setSalesBody([]);
            }
        }*/
        
    })()
},[nombre])


  return (
    <div className="Corporativo">
        <div className="marco">
            <Link to={`/CrearPlanta`}>
                <button>Crear Planta</button>
            </Link>
            <Link to={`/ModificarPlanta`}>
                <button>Modificar Planta</button>
            </Link>
            <Link to={`/EliminarPlanta`}>
                <button>Eliminar Planta</button>
            </Link>
        </div>
        <div className="marco2">
          <form>
              <label>
                  <p>Nombre</p>
                  <input 
                      type="text"
                      //value={nombre}
                      onChange={e => a = e.target.value}
                  />
              </label>
              <label >
                  <p>Provincia</p>
                  <input 
                      type="text"
                      //value={provincia}
                      onChange={e => b = e.target.value}
                  />
              </label>
              <label>
                  <p>Cantón</p>
                  <input 
                      type="text"
                      //value={canton}
                      onChange={e => c = e.target.value}
                  />
              </label>
              <label >
                  <p>Distrito</p>
                  <input 
                      type="text"
                      //value={distrito}
                      onChange={e => d = e.target.value}
                  />
              </label>
              <label>
                  <p>Dirección Exacta</p>
                  <input 
                      type="text"
                      //value={direccionExacta}
                      onChange={e => e = e.target.value}
                  />
              </label>
              <label >
                  <p>Teléfono</p>
                  <input 
                      type="text"
                      //value={telefono}
                      onChange={e => f = e.target.value}
                  />
              </label>
          </form>
          <button onClick={setDatos(a,b,c,d,e,f)} >Click me</button>
      </div>
    </div>
  );
  }
  
  export default CrearP;
